import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink
} from './NavbarElements';
import { BsPersonFill } from "react-icons/bs";
import { AiFillHeart } from "react-icons/ai";

const Navbar = () => {
  return (
    <>
      <Nav style={{borderBottomWidth:"2px"}}>

        <NavMenu>
          <NavLink to='/'>
            <img src={require('../../images/logo.png')} alt='logo' />
          </NavLink>
          <NavLink to='/about' activeStyle>
            Game
          </NavLink>
          <NavLink to='/services' activeStyle>
            Tin tá»©c
          </NavLink>
        </NavMenu>
        <input
        type="text"
        placeholder="Search"
        style={{
          width:"300px",
          height:"40px",
        marginTop:'5px',
        marginBottom:'5px'
        }}

      />
        <NavMenu className="margin" >
          <NavLink to='/'>
            <AiFillHeart size={32} color="#F26725"/>
          </NavLink>
          <NavLink to='/'>
            <BsPersonFill size={32} color="#F26725" />
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};

export default Navbar;
